\begin{tikzpicture}[scale=0.3]
 \tikzmath{\h = 3; \w = 1;}
%%% Block Toeplitz
\tikzmath{\l = 0; \t = 3*\h; }
\foreach \x in {0,\h,3*\h}{
\filldraw[fill=blue, draw=black] (\l+ \x, \t - \x -\h ) rectangle ++(\h,\h);
}
\foreach \x in {\h,2*\h}{
\filldraw[fill=blue!50, draw=black] (\l+ \x, \t - \x) rectangle ++(\h,\h);
\filldraw[fill=blue!50, draw=black] (\l+ \x+\h, \t - \x-\h) rectangle ++(\h,\h);
}
\foreach \x in {2*\h}{
\filldraw[fill=blue!20, draw=black] (\l+ \x, \t - \x) rectangle ++(\h,\h);
\filldraw[fill=blue!20, draw=black] (\l+ \x+ \h, \t - \x-\h) rectangle ++(\h,\h);
}
\filldraw[fill=blue!10, draw=black](\l+3*\h, \t -\x-\h)rectangle ++(\h,\h);

\filldraw[fill=blue!20, draw=black](\l, \t -\x)rectangle ++(\h,\h);
\filldraw[fill=blue!50, draw=black](\l + 3*\h, \t -\x + \h)rectangle ++(\h,\h);

\node at (\l +3*\h + 3*\h/2, 3*\h/2) {$\ddots$};
\draw[matrix of math nodes] ( \l + 3*\h/2, \t -\x/2 ) + ( 1,0) 
matrix [rows in empty cells, nodes={text height=1.5ex}] {
a_{\x -1} & a_{\x} & a_{\x + 1} & \cdots \\
 };

 \tikzmath{\m = \l + 4.5*\h; \t = \t - 3*\h;}
\filldraw[fill=blue, draw=black] (\m, \t -3*\h ) rectangle ++(\h,\h);
\foreach \x in {0,\h,3*\h}{
\filldraw[fill=blue!50, draw=black] (\m + \x, \t -3*\h -\x) rectangle ++(\h,\h);
}
\foreach \x in {\h,2*\h}{
\filldraw[fill=blue!50, draw=black] (\m + \x, \t -3*\h -\x) rectangle ++(\h,\h);
}
\foreach \x in {2*\h}{
\filldraw[fill=blue!20, draw=black] (\m + \x, \t -3*\h ) rectangle ++(\h,\h);
\filldraw[fill=blue!20, draw=black] (\m + \x+ \h, \t -3*\h -\h) rectangle ++(\h,\h);
}
\foreach \x in {2*\h}{
\filldraw[fill=blue!10, draw=black] (\m + \x, \t -3*\h ) rectangle ++(\h,\h);
\filldraw[fill=blue!10, draw=black] (\m + \x+ \h, \t -3*\h + \h) rectangle ++(\h,\h);
}
\filldraw[fill=blue!20, draw=black](\m +3*\h, \t -3*\h + \h)rectangle ++(\h,\h);

\filldraw[fill=blue!10, draw=black](\m, \t -3*\h + \h)rectangle ++(\h,\h);
\filldraw[fill=blue!50, draw=black](\m + 3*\h, \t -3*\h -\h)rectangle ++(\h,\h);

\node at (\m + 4*\h + 3*\h/2, 3*\h/2) {$\ddots$};
\draw[matrix of math nodes] (\m + 4*\h/2, \t -3*\h/2 ) + (1,0) 
matrix [rows in empty cells, nodes={text height=1.5ex, text depth=0.25ex}] {
a_{\x -1} & a_{\x} & a_{\x + 1} & \cdots \\
 };
\end{tikzpicture}

