    (axis cs:3,0) node [above right] {$\vec{e}_1$} %
  }
    coordinate [pos=0.66] (e1)
  ;
  \addplot [->, blue] coordinates {
    (axis cs:0,3) node [above left] {$\vec{e}_2$} %
  }
    coordinate [pos=0.45] (e2)
  ;
  % draw the dashed equator
  \addplot[dashed] coordinates {(-3,0) (3,0)};
  % the dashed radial lines and the labels \(r\)
  \pgfplotsinvokeforeach {-3,-2,...,3} {
    \draw[dashed] (axis cs:0,{abs(#1)}) -- (axis cs:{abs(#1)},0) node [below] {$r=#1$};
